            " \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' As \'Cadena\'\r\nFrom OINV A0\r\nInner Join" +
            " INV5 A1 On A0.DocEntry = A1.AbsEntry\r\nInner Join OWHT A2 On A1.WTCode = A2.WTCo" +
